import { PROFILE_LOADING,GET_PROFILE } from "../actions/types";
const initialState ={

    profile:null,
    profiles:null,
    loading:false
}
export default function(state =initialState,action) {
    switch(action.type) {
        case PROFILE_LOADING:
            return {
                ...state,
                lao
            }
        default:
            return state;
    }
}
